/* nagivation bar on top of website */

export default function Navbar(prop) {
  alert(prop.isLoggedIn.value);
  alert("is admin" + prop.Admin.value)
  alert("is customer" + prop.Customer.value)
  return (
    <nav className="navbar">
      {!prop.isLoggedIn.value && (
        <a href="/" className="site-title">
          ABC
        </a>
      )}

      {prop.isLoggedIn.value && prop.Customer.value && (
        <a href="/" className="site-title">
          ABC
        </a>
      )}

      {prop.isLoggedIn.value && prop.Admin.value && (
        <a href="/adminHome" className="site-title">
          Admin Home
        </a>
      )}

      <ul>
        {prop.Admin.value && (
          <li>
            <a href="/manage">Manage Movie</a>
          </li>
        )}

        {prop.Admin.value && (
          <li>
            <a href="/manageUser">Manage User</a>
          </li>
        )}

        {prop.Admin.value && (
          <li>
            <a href="/managePromo">Manage Promo</a>
          </li>
        )}

        {(prop.Customer.value || !prop.isLoggedIn.value) && (
          <li>
            <a href="/search">Search</a>
          </li>
        )}

        {(prop.Customer.value || prop.Admin.value) && (
          <li>
            <a href="/profile">Profile</a>
          </li>
        )}

        {!prop.isLoggedIn.value && (
          <li>
            <a href="/login">Login</a>
          </li>
        )}

        {prop.isLoggedIn.value && (
          <li>
            <a href="/logout">Logout</a>
          </li>
        )}
      </ul>
    </nav>
  );
}
